import React from 'react';
import jsPDF from 'jspdf';





class Form extends React.Component {
    constructor(props){
        super(props);
        this.name=React.createRef();
        this.cellulare=React.createRef();
        this.note=React.createRef();
        this.Sistemazione=React.createRef();
        this.Checkin=React.createRef();
        this.Checkout=React.createRef();
        this.numeroNotti=React.createRef();
        this.numeroAdulti=React.createRef();
        this.prezzo=React.createRef();


       

        this.submitHandler = this.submitHandler.bind(this);

    }

    submitHandler=(event) => {
        event.preventDefault();
        
        const doc = new jsPDF();
        const image = 'data:image/jpeg;base64,'

        doc.addImage(image, 'JPEG',0,0,210,297);
        
        const name= this.name.current.value;
        const cellulare= this.cellulare.current.value;
        const Sistemazione= this.Sistemazione.current.value;
        const Checkinyymmdd= new Date(this.Checkin.current.value);
        const Checkin=Checkinyymmdd.getDate() + "-" + (Checkinyymmdd.getMonth() + 1) + "-" + Checkinyymmdd.getFullYear();
        const Checkoutyymmdd= new Date(this.Checkout.current.value);
        const Checkout=Checkoutyymmdd.getDate() + "-" + (Checkoutyymmdd.getMonth() + 1) + "-" + Checkoutyymmdd.getFullYear();
        const numeroNotti= this.numeroNotti.current.value;
        const numeroAdulti= this.numeroAdulti.current.value;
        const prezzo= this.prezzo.current.value;
        const note= this.note.current.value;

        
        console.log(name,cellulare, Sistemazione, Checkin, Checkout, numeroAdulti, numeroNotti, prezzo)
        doc.addFont('tahoma','tahoma','normal');
       doc.setFont('tahoma');
       doc.setFontSize(12);
       doc.text(name,39.6,70.8)
       doc.text(name,74.5,100.7)
       doc.text(cellulare,74.5,109.1)
       doc.text(Sistemazione,74.5,116.8)
       doc.text(Checkin,74.5,124.6)
       doc.text(Checkout,74.5,132.4)
       doc.text(numeroNotti,74.5,141.2)
       doc.text(numeroAdulti,74.5,149)
       doc.text(prezzo,80.3,173.7)
       doc.text(note,19,184.5)
            
        doc.save('Conferma_prenotazione.pdf');
    }
     
    
    
  
  render(){
        return (
        <React.Fragment>
        <div className="form-container">
        <form id="my-form" onSubmit={this.submitHandler}>
            <div className="form-group">
                <label htmlFor="Nome">Nome</label>
                <input type="text" className="form-control" ref={this.name}  placeholder="Nome"/>
            </div>
            <div className="form-group">
                <label htmlFor="Cellulare">Cellulare</label>
                <input type="number" className="form-control" ref={this.cellulare}  placeholder="Cellulare"/>
            </div>
             <div className="form-group">
                <label htmlFor="Sistemazione">Tipologia di Sistemazione</label>
                <input type="text" className="form-control" ref={this.Sistemazione}  placeholder="Sistemazione" maxLength="50"/> 
            </div>
            <div className="form-group">
                <label htmlFor="Checkin">Checkin</label>
                <input type="date" className="form-control" ref={this.Checkin}  placeholder="Checkin"/>
            </div>
            <div className="form-group">
                <label htmlFor="Checkout">Checkout</label>
                <input type="date" className="form-control" ref={this.Checkout}  placeholder="Checkout"/>
            </div>
            <div className="form-group">
                <label htmlFor="Numero notti">Numero notti</label>
                <input type="number" className="form-control" ref={this.numeroNotti}   placeholder="Numero notti"/>
            </div>
            <div className="form-group">
                <label htmlFor="Numero adulti">Numero adulti</label>
                <input type="number" className="form-control" ref={this.numeroAdulti}  placeholder="Numero adulti"/>
            </div>
            <div className="form-group">
                <label htmlFor="prezzo">Prezzo</label>
                <input type="number" className="form-control" ref={this.prezzo}  placeholder="Prezzo" step="0.01"/>
            </div>  
            <div className="form-group">
                <label htmlFor="Note">Note</label>
                <textarea className="form-control" ref={this.note}  rows="3" maxLength="80"></textarea>
            </div>   
            
            <button type="submit" className="btn btn-primary" >Submit</button>

        </form>
        </div>
    </React.Fragment>
        );
  };
};
export default Form

